def commonChild(s1, s2):
    ln_s1 = len(s1)
    ln_s2 = len(s2)
    m_s1 = ln_s1 + 1
    m_s2 = ln_s2 + 1
    s1 = ' ' + s1
    s2 = ' ' + s2

    memo =[[0] * m_s2 for i in range(m_s1)]
    for i in range(1, m_s1):
        for j in range(1, m_s2):
            #print (str(i) + ", " + str(j))
            if s1[i] == s2[j]:
                #print("s1:" + str(s1[i] + " s2:" + str(s2[j])))
                memo[i][j] = 1 + memo[i-1][j-1]
            else:
                memo[i][j] = max(memo[i-1][j], memo[i][j-1])
    return max(map(max, memo))

def commonChild2(s1, s2):
    ln_s1 = len(s1)
    ln_s2 = len(s2)
    memo = {}

    def isCommon(i, j):
        if i >= ln_s1 or j >= ln_s2:
            return 0
        old_i = i
        old_j = j

        if (i, j) in memo:
            return memo[(i, j)]
        if s1[i] == s2[j]:
            i += 1
            j += 1
            memo[(old_i, old_j)] = 1 + isCommon(i, j)
            return memo[(old_i, old_j)]
        else:
            new_i = i + 1
            new_j = j + 1
            memo[(old_i, old_j)] = max(isCommon(new_i, j), isCommon(i, new_j))
            return memo[(old_i, old_j)]

    return isCommon(0, 0)

